    gp = [[] for _ in range(4)]
    for (w, c) in souvenirs:
        gp[w].append(c)
    for i in range(1, 4):
        gp[i].sort(reverse=True)
    for i in range(m + 1):
        one = dp[i][1]
        two = dp[i][2]
        if one < len(gp[1]):
            if dp[i + 1][0] < dp[i][0] + gp[1][one]:
                dp[i + 1] = (dp[i][0] + gp[1][one], one + 1, two)
        if two < len(gp[2]):
            dp[i + 2] = (dp[i][0] + gp[2][two], one, two + 1)
    for i in range(1, m + 1):
        dp[i] = max(dp[i - 1], dp[i])
    ans = dp[m][0]
    tot = 0
    for i in range(len(gp[3]) + 1):
        if 3 * i <= m:
            ans = max(dp[m - 2 * i][0] + tot, ans)
            if i < len(gp[3]):
                tot += gp[3][i]
    return ans

